//add classList .disabled-btn
function disableBtn(e){
    e.target.classList.add('disabled-btn');
}

//remove classList .disabled-btn
function enableBtn(e){
    e.target.classList.remove('disabled-btn');
}

export{disableBtn,enableBtn}
